nav {
  position: fixed;
  width: 100%;
  z-index: 10;
  background-color: #282827;
}

.navbar__wrapper {
  height: 100px;
  display: flex;
  justify-content: space-between;
  align-items: center;
}
.navbar__rightmenu {
  display: inline-flex;
  align-items: center;
}
.navbar__menu {
  display: flex;
  align-items: center;
  list-style-type: none;
  font-style: normal;
  font-weight: 400;
  font-size: 14px;
  line-height: 19px;
}
.navbar__menu a {
  text-decoration: none;
}
.navbar__menu a:hover {
  color: #999;
}
.navbar_item {
  padding-left: 45px;
}
.navbar_link {
  font-style: normal;
  font-weight: 400;
  font-size: 14px;
  line-height: 19px;
  color: #E3E3E2;
}
.navbar__contactphone {
  display: block;
  margin-left: 55px;
  font-style: normal;
  font-weight: 700;
  font-size: 18px;
  line-height: 25px;
  text-align: right;
  color: #E3E3E2;
}
.navbar__contactphone a {
  text-decoration: none;
}
.navbar__contactphone:hover {
  color: #CB4544;
}
.navbar__hr {
  margin-left: 40px;
  width: 2px;
  height: 70px;
  background: #40403D;
  border: none;
}
.navbar_icon {
  margin-left: 20px;
  font-size: 26px;
}

